INSERT INTO `programma` VALUES (1,'L\'eredità','ciao','img/progs/prog_1.jpg','https://www.google.it',NULL,1,1,1,8,120,19),(2,'Harry Potter e la Pietra Filosofale','Harry Potter e la pietra filosofale (Harry Potter and the Philosopher\'s Stone, distribuito negli Stati Uniti, Pakistan, Sri Lanka e India come Harry Potter and the Sorcerer\'s Stone)[1][2][3] è un film del 2001 diretto da Chris Columbus, sceneggiato da Steve Kloves, prodotto da David Heyman e distribuito dalla Warner Bros.[4], adattamento cinematografico dell\'omonimo libro, primo episodio della serie di Harry Potter, scritta dall\'autrice britannica J. K. Rowling.\n\n        La storia narra del primo anno di Harry Potter a Hogwarts dove scopre di essere un mago famoso e inizia la sua istruzione magica. Nel film compaiono Daniel Radcliffe nel ruolo di Harry Potter assieme a Rupert Grint ed Emma Watson in quelli dei migliori amici di Harry, Ron Weasley e Hermione Granger. Il film ha avuto sette seguiti il primo dei quali è stato La camera dei segreti.\n        \n        La Warner Bros. comprò i diritti del libro nel 1999 per un valore riportato di 1 milione di sterline. La produzione ebbe inizio nel Regno Unito nel 2000, con Columbus scelto per dirigere il film da una lista di registi tra i quali comparivano Steven Spielberg e Rob Reiner. J.K. Rowling insistette affinché l\'intero cast del film fosse britannico o irlandese così da mantenere l\'integrità culturale del libro. Le riprese del film hanno avuto luogo sia ai Leavesden Film Studios sia in luoghi storici nel Regno Unito.\n        \n        Il film è stato distribuito nelle sale del Regno Unito e degli Stati Uniti nel novembre 2001 ricevendo critiche positive e incassando più di 974 milioni di dollari al botteghino mondiale. Il film è stato inoltre candidato a diversi premi, tra i quali gli Oscar per la migliore colonna sonora, migliore scenografia e migliori costumi. A febbraio 2019 è al quarantasettesimo posto nella classifica dei film di maggiore incasso della storia del cinema ed è il secondo grande incasso della serie dietro al film conclusivo della serie stessa, Harry Potter e i Doni della Morte - Parte 2.','img/progs/prog_2.jpg','https://www.google.it',NULL,NULL,NULL,2,5,110,0),(3,'The Matrix','Descrizione di prova','img/progs/prog_3.jpg','https://it.wikipedia.org/wiki/Matrix',NULL,NULL,NULL,3,6,124,0),(4,'The Mentalist','Descrizione','img/progs/prog_4.jpg','https://it.wikipedia.org/wiki/The_Mentalist',4,1,1,4,8,110,0),(5,'Breaking Bad','Descrizione','img/progs/prog_5.jpg','https://it.wikipedia.org/wiki/Breaking_Bad',5,1,1,5,3,120,0),(6,'Mission: Impossible','Descrizione','img/progs/prog_6.jpg','https://it.wikipedia.org/wiki/Mission:_Impossible',NULL,NULL,NULL,2,9,180,0),(7,'Shrek','Descrizione','img/progs/prog_7.jpg','https://it.wikipedia.org/wiki/Shrek_(film)',NULL,NULL,NULL,1,1,100,0),(8,'Indiana Jones: I Predatori dell\'arca perduta','Descrizione','img/progs/prog_8.jpg','https://it.wikipedia.org/wiki/I_predatori_dell%27arca_perduta',NULL,NULL,NULL,2,2,120,0),(9,'Reprisal: Caccia all\'uomo','Descrizione','img/progs/prog_9.jpg','https://it.wikipedia.org/wiki/Reprisal_(film_2018)',NULL,NULL,NULL,2,9,120,0),(10,'CiaoDarwin7','Descrizione','img/progs/prog_10.jpg','http://google.com',NULL,1,1,1,4,120,1),(11,'Garfield 2','Descrizione','img/progs/prog_11.jpg','https://it.wikipedia.org/wiki/Garfield_2',NULL,NULL,NULL,1,1,120,0),(12,'21 Blackjack','Descrizione','img/progs/prog_12.jpg','https://it.wikipedia.org/wiki/21_(film)',NULL,NULL,NULL,2,5,120,0),(13,'The Mentalist','Descrizione','img/progs/prog_4.jpg','https://it.wikipedia.org/wiki/The_Mentalist',4,1,2,4,8,110,0),(14,'TheMentalist','Descrizione',NULL,'https://it.wikipedia.org/wiki/The_Mentalist',4,1,3,4,8,110,2),(15,'The Mentalist','Descrizione','img/progs/prog_4.jpg','https://it.wikipedia.org/wiki/The_Mentalist',4,1,4,4,8,110,0);
